// populate Artists

function populateArtists() {
    artistCardsContainer.innerHTML = '';
    artistsData.forEach((artist, index) => {
        if (index < 20) {
            const card = document.createElement('div');
            card.setAttribute("id", "card");
            card.classList.add('col-md-3', 'artist-card');
            card.innerHTML = `
                <div class="card">
                    <img src="${artist.image}" class="card-img-top" alt="${artist.artistName}">
                    <div class="card-body">
                        <h5>${artist.artistName}</h5>
                        <p>${artist.birthDayAsString}</p>
                        <button 
                            class="btn btn-dark" 
                            data-artist-content-id="${artist.contentId}" 
                            onclick="showArtistDetails(this)">
                            View More
                        </button>
                    </div>
                </div>`;
            artistCardsContainer.appendChild(card);
        }
    });
}

// Show artist details including their famous paintings
function showArtistDetails(button) {
    const artistContentId = button.getAttribute('data-artist-content-id');
    const artist = artistsData.find(a => a.contentId === parseInt(artistContentId));

    if (!artist) {
        alert("Artist details not found!");
        return;
    }

    const mainDiv = document.getElementById('main');
    if (mainDiv) {
        mainDiv.style.display = 'none';
    }

    // Find paintings by this artist
    const artistPaintings = paintingsData.filter(p => p.artistContentId === parseInt(artistContentId));

    // Outer Div
    const outerDiv = document.createElement('div');
    outerDiv.className = 'outer-div';

    // Inner Div 1: Artist Info
    const artistInfoDiv = document.createElement('div');
    artistInfoDiv.className = 'artist-info';

    // Artist Image
    const artistImageDiv = document.createElement('div');
    artistImageDiv.className = 'artist-image';
    artistImageDiv.innerHTML = `
        <img src="${artist.image}" alt="${artist.artistName}">
    `;

    // Artist Details
    const artistDetailsDiv = document.createElement('div');
    artistDetailsDiv.className = 'artist-details';
    artistDetailsDiv.innerHTML = `
        <h2>${artist.artistName}</h2>
        <p><strong>Born:</strong> ${artist.birthDayAsString}</p>
        <p><strong>Death:</strong> ${artist.deathDayAsString}</p>
        <p><strong>Wiki:</strong> <a href="${artist.wikipediaUrl}" target="_blank">${artist.wikipediaUrl}</a></p>
    `;

    // Append Image and Details to Artist Info Div
    artistInfoDiv.appendChild(artistImageDiv);
    artistInfoDiv.appendChild(artistDetailsDiv);

    // Inner Div 2: Artist Paintings
    const artistPaintingsDiv = document.createElement('div');
    artistPaintingsDiv.className = 'artist-paintings';
    artistPaintingsDiv.innerHTML = `
        <h3>Famous Paintings:</h3>
        <div class="paintings-container">
            ${artistPaintings.length > 0
            ? artistPaintings.map(p => `
                    <div class="painting-item">
                        <img src="${p.image}" alt="${p.title}">
                        <h4>${p.title} (${p.yearAsString})</h4>
                    </div>`).join('')
            : '<p>No paintings found</p>'
        }
        </div>
    `;

    // Close Button
    const closeButton = document.createElement('button');
    closeButton.className = 'close-button';
    closeButton.textContent = 'Close';
    closeButton.onclick = () => {
        const modal = document.getElementById('artist-modal');
        if (modal) modal.remove();
        if (mainDiv) mainDiv.style.display = 'block';
    };

    // Append Inner Divs and Close Button to Outer Div
    outerDiv.appendChild(closeButton);
    outerDiv.appendChild(artistInfoDiv);
    outerDiv.appendChild(artistPaintingsDiv);

    // Create or Update Modal
    const modal = document.getElementById('artist-modal') || document.createElement('div');
    modal.id = 'artist-modal';
    modal.className = 'artist-modal';
    modal.innerHTML = '';
    modal.appendChild(outerDiv);

    document.body.appendChild(modal);
}



// Populate Paintings
function populatePaintings() {
    paintingCardsContainer.innerHTML = '';
    let i = 0;
    paintingsData.forEach(painting => {
        if (i < 15) {
            const card = document.createElement('div');
            card.classList.add('col-md-4', 'painting-card');
            card.innerHTML = `<div class="card"><img src="${painting.image || 'https://via.placeholder.com/150'}" class="card-img-top" alt="${painting.title}"><div class="card-body"><h5>${painting.title}</h5><p>${painting.artistName}</p></div></div>`;
            paintingCardsContainer.appendChild(card);
            i++;
        }
    });
}

// Show painting details
function showPaintingDetails(title) {
    const painting = paintingsData.find(p => p.title === title);
    alert(`Title: ${painting.title}\nArtist: ${painting.artist}\nYear: ${painting.year}\nDescription: ${painting.description}`);
}

// Search function
function search() {
    const query = document.getElementById('search').value.toLowerCase();
    artistCardsContainer.innerHTML = '';
    paintingCardsContainer.innerHTML = '';

    const filteredArtists = artistsData.filter(artist => artist.artistName.toLowerCase().includes(query));
    const filteredPaintings = paintingsData.filter(painting => painting.title.toLowerCase().includes(query));

    filteredArtists.forEach((artist) => {
        const card = document.createElement('div');
        card.classList.add('col-md-3', 'artist-card');
        card.innerHTML = `
            <div class="card">
                <img src="${artist.image}" class="card-img-top" alt="${artist.artistName}">
                <div class="card-body">
                    <h5>${artist.artistName}</h5>
                    <p>${artist.birthDayAsString}</p>
                    <button 
                        class="btn btn-dark" 
                        data-artist-content-id="${artist.contentId}" 
                        onclick="showArtistDetails(this)">
                        View More
                    </button>
                </div>
            </div>`;
        artistCardsContainer.appendChild(card);
    });

    filteredPaintings.forEach(painting => {
        const card = document.createElement('div');
        card.classList.add('col-md-4');
        card.innerHTML = `<div class="card"><img src="${painting.image}" class="card-img-top" alt="${painting.title}"><div class="card-body"><h5>${painting.title}</h5><p>${painting.artistName}</p></div></div>`;
        paintingCardsContainer.appendChild(card);
    });
}


// About Section
function aboutSection(mainDiv) {
    const aboutSection = document.createElement('section');
    aboutSection.id = 'about';
    aboutSection.classList.add('section', 'bg-light');
    aboutSection.style.borderTop = '2px solid black';
    aboutSection.style.padding = '40px 20px';
    aboutSection.innerHTML = `
        <div class="container" style="display: flex; flex-wrap: wrap; align-items: center; flex-direction: row-reverse;">
            <!-- Left Content -->
            <div style="flex: 1; padding: 20px; max-width: 50%;">
                <h2 class="text-center" style="font-size: 28px; margin-bottom: 20px;">About</h2>
                <p style="font-size: 16px; line-height: 1.6;">
                    Welcome to our art gallery website! Our platform is dedicated to showcasing the lives and works of renowned artists from around the globe. 
                    Explore their iconic paintings and learn about their creative journeys.
                </p>
                <p style="font-size: 16px; line-height: 1.6;">
                    From classic masterpieces to modern art innovations, we aim to connect art enthusiasts with the timeless beauty and rich history of art. 
                    Dive into a world of creativity and be inspired by the stories behind each stroke.
                </p>
            </div>
            
            <!-- Right Image -->
            <div style="flex: 1; padding: 20px; max-width: 50%; display: flex; justify-content: center;">
                <img 
                    src="images/about.webp" 
                    alt="Art Showcase" 
                    style="width: 100%; max-width: 400px; border-radius: 10px; box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);"
                />
            </div>
        </div>
    `;

    mainDiv.appendChild(aboutSection);

    // Add contact section after about section
    contactSection(mainDiv);
}

// contact section

function contactSection(mainDiv) {
    const contactSection = document.createElement('section');
    contactSection.id = 'contact';
    contactSection.classList.add('section', 'bg-light');
    contactSection.style.borderTop = '2px solid black';
    contactSection.style.padding = '40px 20px';
    contactSection.innerHTML = `
        <div class="container" style="display: flex; flex-wrap: wrap; align-items: center; flex-direction: row;">
            <!-- Left: Contact Form -->
            <div style="flex: 1; padding: 20px; max-width: 50%;">
                <h2 class="text-center" style="margin-bottom: 20px;">Contact Us</h2>
                <form id="contact-form">
                    <div class="mb-3">
                        <label for="name" class="form-label">Name</label>
                        <input type="text" class="form-control" id="name" placeholder="Your Name" required style="padding: 10px; font-size: 16px;">
                    </div>
                    <div class="mb-3">
                        <label for="email" class="form-label">Email</label>
                        <input type="email" class="form-control" id="email" placeholder="Your Email" required style="padding: 10px; font-size: 16px;">
                    </div>
                    <div class="mb-3">
                        <label for="message" class="form-label">Message</label>
                        <textarea class="form-control" id="message" rows="3" required style="padding: 10px; font-size: 16px;"></textarea>
                    </div>
                    <button type="submit" class="btn btn-dark" style="border: none; padding: 10px 20px; font-size: 16px;">Submit</button>
                </form>
            </div>

            <!-- Right: Image -->
            <div style="flex: 1; padding: 20px; max-width: 50%; display: flex; justify-content: center;">
                <img 
                    src="images/contact.png" 
                    alt="Contact Illustration" 
                    style="width: 100%; max-width: 400px; border-radius: 10px; box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);"
                />
            </div>
        </div>
    `;

    mainDiv.appendChild(contactSection);

    // Add form submission event listener
    const contactForm = document.getElementById('contact-form');
    contactForm.addEventListener('submit', function (e) {
        e.preventDefault(); // Prevent form submission

        // Get form data
        const name = document.getElementById('name').value;
        const email = document.getElementById('email').value;
        const message = document.getElementById('message').value;

        // Store data in local storage
        localStorage.setItem('contactName', name);
        localStorage.setItem('contactEmail', email);
        localStorage.setItem('contactMessage', message);

        // Display a success message and clear the form
        alert("Your message has been successfully sent!");
        contactForm.reset();
    });

    footer(mainDiv);
}

// Footer

function footer(mainDiv) {
    const footer = document.createElement('footer');
    footer.classList.add('bg-dark', 'text-white', 'text-center', 'py-4');

    // Footer text
    const footerText = document.createElement('p');
    footerText.innerHTML = `&copy; 2024 Art Gallery. All rights reserved.`;
    footer.appendChild(footerText);
    
    mainDiv.appendChild(footer);
}

